func If[T any](cond bool, vTrue, vFalse T) T {
	if cond {
		return vTrue
	}
	return vFalse
}

func GetDays(t1 int64, t2 int64) int64 {
	if t1 >= t2 {
		return 0
	} else {
		delta := t2 - t1
		extra := If(delta%MILLISECONDS_PER_DAY == 0, int64(0), int64(1))
		return int64(math.Floor(float64(delta/MILLISECONDS_PER_DAY))) + extra
	}
}
